import React from "react";
import { Link } from "react-router-dom";

function Header() {
  return (
    <nav>
      <h1>TechStar.</h1>
      <main>
        <Link to={"/"}>Home</Link>
        <Link to={"/contact "}>Contact</Link>
        <Link to={"/#about"}>About</Link>
        <Link to={"/#brand"}>Home</Link>
        <Link to={"/"}>Home</Link>
      </main>
    </nav>
  );
}

export default Header;
